escription\" /><meta content=\"http://www.n1sports.com.br/\" property=\"og:url\" /><meta content=\"http://www.n1sports.com.br/assets/img/n1-sports-logo.png\" property=\"og:image\" /><meta content=\"website\" property=\"og:type\" /><meta content=\"N1 Sports\" property=\"og:site_name\" /><meta content=\"pt_BR\" property=\"og:locale\" /><script type=\"text/javascript\">\r\n</script>',1,NULL,NULL,NULL,2),(42,'contato@formulariodosite.com.br','0001-01-01 00:00:00','smtp.formulariodosite.com.br','','smtp-formulariodosite-com-br','T','','','587','zpsite15!','',1,NULL,NULL,NULL,4),(97,'','0001-01-01 00:00:00','','','1','T','','','0','','',1,NULL,NULL,NULL,41),(125,'','0001-01-01 00:00:00','','','5','T','Suspendisse et tincidunt ipsum, et dignissim urna. Vestibulum nisl tortor, gravida at magna et, suscipit vehicula massa. Suspendisse et tincidunt ipsum, et dignissim urna. Vestibulum nisl tortor, gravida at magna et, suscipit vehicula massa. Suspendisse et tincidunt ipsum, et dignissim urna. Vestibulum nisl tortor, gravida at magna et, suscipit vehicula massa. Suspendisse et tincidunt ipsum, et dignissim urna. Vestibulum nisl tortor, gravida at magna et, suscipit vehicula massa. Suspendisse et tincidunt ipsum, et dignissim urna. Vestibulum nisl tortor, gravida at magna et, suscipit vehicula massa.--','','0','','',1,NULL,NULL,NULL,55),(126,'','0001-01-01 00:00:00','Bem vindo a N1 Sports!','','bem-vindo-a-n1-sports','T','Seja bem vindo a Loja #1 dos fanáticos por esporte! Aqui você encontra artigos variados para a prática esportiva individual ou coletiva e ainda conta com o atendimento de quem entende do assunto.<br />\r\nNavegue pelo site e confira os produtos e ofertas que sempre temos para você, seu time, instituição, projeto ou empresa.<br />\r\nAlém de tudo isso, por WhatsApp você tem à disposição um canal de contato para tirar dúvidas ou até mesmo para finalizar suas compras.<br />\r\nAproveite!','','0','','',1,NULL,NULL,NULL,56),(133,'n1.lojavirtual@gmail.com','0001-01-01 00:00:00','','','0','T','','','0','','',1,NULL,NULL,NULL,62),(135,'125675@correios','0001-01-01 00:00:00','9912387906','','9912387906','T','','','N','91350-100','',1,NULL,NULL,NULL,64),(136,'','0001-01-01 00:00:00','Obrigado por comprar com a gente!','','obrigado-por-comprar-com-a-gente','T','Compra finalizada com sucesso!','','0','','',1,NULL,NULL,NULL,65),(152,'n1.lojavirtual@gmail.com','0001-01-01 00:00:00','','','7','T','','','0','','',1,NULL,NULL,NULL,79),(155,'n1.lojavirtual@gmail.com','0001-01-01 00:00:00','','','6','T','','','0','','',1,NULL,NULL,NULL,81),(160,'','0001-01-01 00:00:00','','','8','T','Por favor, informe no campo ao lado o endereço de e-mail utilizado no cadastro e verifique sua caixa de entrada. Enviaremos um link com instruções para o cadastro de uma nova senha.','','0','','',1,NULL,NULL,NULL,57),(161,'','0001-01-01 00:00:00','Quem Somos','','quem-somos','T','A N1 Sports é uma empresa especializada no comércio e distribuição de artigos esportivos. Vendemos para todo Brasil e atendemos pessoas físicas e jurídicas.<br />\r\n<br />\r\nNossos clientes são atletas profissionais e amadores engajados em viver pelo esporte, um público diferenciado que entende e sabe o que usa, sejam esportistas profissionais, amadores ou, ainda, instituições voltadas ao esporte.<br />\r\n<br />\r\n<b>Uma empresa jovem e inspirada</b><br />\r\nA N1 Sports iniciou suas atividades em 2013 com a proposta de atuar no marketing e consultoria de varejo na área dos esportes. Três anos mais tarde voltou-se ao comércio e distribuição de artigos esportivos focada em atender um público seleto e especializado que necessita de exclusividade, conhecimento técnico e produtos de alta <i>performance</i>.<br />\r\n <br />\r\nOriginalmente o nome da empresa era “N1m”, criação totalmente inspirada em Ronaldo Nazário e sua “<i>9ine”</i>, agência de marketing esportivo que representava atletas como Anderson Silva e Neymar à época. Com o tempo a empresa tornou-se somente “N1”, pois no esporte a inspiração está no atleta “número um” no que faz. Com isso, estamos dizendo que queremos “ser a inspiração para nossos clientes”.<br />\r\n<br />\r\n<b>Uma empresa enxuta e voltada ao cliente</b><br />\r\nVocê está comprando <i>online</i>, mas sua experiência é real! Por isso, fazemos questão de manter contato com nosso cliente, auxiliar na compra, ajuda-lo a decidir pelo melhor e mantê-lo informado sobre seus produtos até que sejam entregues. Contudo, qualidade no atendimento e nos produtos não basta: é preciso ter preços e condições que só uma empresa enxuta e voltada ao cliente pode oferecer.<br />\r\nNa <i>N1Sports</i> todos os processos internos foram cuidadosamente organizados pensando na experiência de compra do cliente. São eles:<br />\r\n<br />\r\n<b>Suporte ao Cliente</b>: cuida do atendimento direto ao cliente durante o processo de compra, negociação e entrega. É a principal área da empresa e todos trabalham para que ela seja a mais perfeita possível.<br />\r\n<br />\r\n<b>Gerência Comercial</b>: atende aos clientes institucionais, busca inovações e se responsabiliza pelo crédito aos clientes. Nossa política de vendas é flexível e tudo passa por essa área.<br />\r\n<br />\r\n<b>Tecnologia & Mídias</b>: são empresas terceirizadas e especializadas na presença digital e Marketing da <i>N1ports</i>. Dentre elas, <i>PagSeguro</i>, <i>Zepol</i> <i>Tecnologia</i> e <i>Agência Elevar</i>.<br />\r\n<br />\r\n<b>Administração</b>: cuida dos aspectos internos, como as políticas de qualidade, sustentabilidade, e também das equipes de trabalho.<br />\r\nAcreditamos que economizar recursos é uma vantagem que pode ser repassada ao cliente para que ele tenha a certeza de que fez a melhor compra.<br />\r\n<br />\r\n<b>Estamos engajados</b><br />\r\nSomos uma empresa preocupada com o meio ambiente. Procuramos racionalizar o consumo de recursos e escolher as melhores fontes para reduzir a “<i>pegada ambiental</i>”.<br />\r\nUtilizamos, por exemplo, embalagens em papel em nossas entregas e constantemente revisamos nossa conduta em relação ao tema <i>sustentabilidade</i>. A maioria de nossos fornecedores também tem a mesma preocupação e esse é um dos critérios de nossas escolhas em relação ao que comercializamos.<br />\r\nEntendemos nossa responsabilidade na transformação de atitudes e queremos que nosso cliente tenha cada vez mais essa preocupação.<br />\r\nPor isso, somente comercializamos:\r\n<ul>\r\n	<li><i>Produtos originais </i>(não são réplicas, falsificações ou pirataria)</li>\r\n	<li><i>Adquiridos de fonte segura </i>(comprados junto a fabricantes legais)</li>\r\n	<li><i>Sem publicidade enganosa </i>(informações dos produtos são verdadeiras)</li>\r\n	<li><i>Respeitando o Código de Defesa do Consumidor </i>(nossa responsabilidade como distribuidor dos produtos)</li>\r\n</ul>\r\nE você não está pagando nada mais por tudo isso! Pelo contrário, quem não confere a procedência é que pode estar se arriscando ao adquirir um produto que não está em conformidade com esses princípios.<br />\r\n ','','0','1','',1,NULL,NULL,NULL,82),(162,'','0001-01-01 00:00:00','Política de Privacidade','','politica-de-privacidade','T','<div>A N1 Sports assume o compromisso de zelar pela segurança e privacidade dos dados<br />\r\npessoais de seus clientes, protegendo essas informações de perda, uso impróprio ou<br />\r\nacesso não autorizado.<br />\r\n<br />\r\nVocê pode navegar pelo nosso site à vontade sem nos dar qualquer informação sobre<br />\r\nseus dados pessoais. Somente na hora de finalizar sua compra que serão solicitadas<br />\r\ninformações indispensáveis para cobrança, emissão da nota fiscal e entrega, mas tudo<br />\r\nserá coletado em formulário específico e de uso privativo do usuário.<br />\r\n<br />\r\nAbaixo seguem os 10 pontos que constituem a nossa Política de Privacidade. É<br />\r\nimportante salientar que o cliente é corresponsável pelo sucesso das condições<br />\r\nde segurança e de privacidade estabelecidas e que, ao conhecê-las, deve também fazer<br />\r\naquilo que está ao seu alcance, como a navegação em dispositivos seguros, cuidar<br />\r\ncom o uso de redes wifi públicas e manter uma senha que não seja fácil de ser<br />\r\ndescoberta.<br />\r\n<br />\r\n1. As informações que nossos clientes nos fornecem são tratadas em padrões<br />\r\nrígidos de segurança e confidencialidade, seja no tráfego pelo site, seja pelo<br />\r\ntrato humano durante as operações de retaguarda e suporte ao cliente.<br />\r\n<br />\r\n2. As informações nunca serão transferidas a terceiros ou usadas para finalidades<br />\r\ndiferentes daquelas para as quais foram coletadas, hipótese que se admite<br />\r\napenas sob determinação judicial.<br />\r\n<br />\r\n3. O acesso às informações coletadas está restrito apenas a empregados da<br />\r\nN1 Sports devidamente treinados e autorizados para o uso adequado dessas<br />\r\ninformações.<br />\r\n<br />\r\n4. Os padrões de segurança e confiabilidade do site são constantemente<br />\r\nmonitorados por empresa externa contratada, devidamente certificada e<br />\r\nadequada aos padrões exigidos para operações na Internet.<br />\r\n<br />\r\n5. Os meios de pagamento online são certificados por empresa mundialmente<br />\r\nreconhecida e especializada, que provê segurança contra fraudes em cartões.<br />\r\n<br />\r\n6. A N1 Sports somente enviará promoções da loja aos clientes que autorizarem.<br />\r\nCaso você as tenha autorizado e não deseja mais receber, poderá desautorizar a<br />\r\nqualquer momento.<br />\r\n<br />\r\n7. A N1 Sports não envia e-mails solicitando dados e informações pessoais. Toda<br />\r\ncoleta de dados ocorre exclusivamente no cadastro do usuário ou login de<br />\r\nacesso, no próprio site, em formulário específico.<br />\r\n<br />\r\n8. Como a maioria dos sites, a N1  Sports também utiliza <i style=\"font-style:italic;\">cookies</i> (pequenos<br />\r\narquivos que rastreiam movimentos dentro dos websites) para melhorar a<br />\r\nexperiência de navegação dos clientes, mas você pode definir que o sistema<br />\r\noperacional de seu dispositivo não aceite os <i style=\"font-style:italic;\">cookies</i>.<br />\r\n<br />\r\n9. Nosso site pode conter links para outros sites externos cujo conteúdo e<br />\r\npolíticas de privacidade não são de responsabilidade da N1 Sports. Aconselha-<br />\r\nse a verificação da política de privacidade antes do acesso.<br />\r\n<br />\r\n10. Estão disponibilizados a todos os usuários e clientes diversos canais de<br />\r\nrelacionamento e suporte. Você deve entrar em contato para dirimir qualquer<br />\r\ndúvida referente à segurança e privacidade da sua compra. Todos os contatos<br />\r\nrealizados são tratados dentro das políticas aqui descritas.</div>','','0','2','',1,NULL,NULL,NULL,82),(163,'','0001-01-01 00:00:00','Como Comprar','','como-comprar','T','Se você está em dúvida sobre como comprar produtos no nosso site, confira o passo-a-passo abaixo!<br />\r\nSe ainda restarem dúvidas, entre em contato conosco. Teremos o maior prazer em ajudá-lo!','','0','1','',1,NULL,NULL,NULL,83),(164,'','0001-01-01 00:00:00','Trocas e Devoluções','','trocas-e-devolucoes','T','A N1Sports está sempre empenhada em criar a melhor experiência de compra para seus clientes. Comercializamos somente produtos originais, de fontes seguras, de qualidade certificada e não promovemos publicidade enganosa. Além disso, realizamos inspeção em cada produto que é embalado e procuramos assegurar que cada compra realizada em nosso site seja atendida dentro dos mais rigorosos padrões de exigência do nosso público.<br />\r\nContudo, nem sempre isso é suficiente e, por isso, nossa Política de Trocas e Devoluções procura contemplar com o maior respeito possível as expectativas de nossos clientes e cumprir integralmente o que prescreve o Código de Defesa do Consumidor.<br />\r\nÉ importante que o cliente também faça sua parte:<br />\r\n<br />\r\n-    Preste atenção ao receber sua encomenda: se estiver violada e com indícios de danos aos produtos no pacote, registre e não receba;<br />\r\n-    Instrua seus familiares ou outras pessoas que poderão receber sua encomenda a procederem da mesma forma;<br />\r\n-    Aja com boa fé: se precisar trocar, faça, é um direito seu, mas não tire proveito próprio da situação omitindo ou mascarando os fatos;<br />\r\n-    Seja responsável: exija produtos originais e cuide sempre da procedência.<br />\r\n<br />\r\n<br />\r\nMOTIVOS PARA TROCA OU DEVOLUÇÃO<br />\r\nInsatisfação com o produto ou o produto não serviu<br />\r\nCaso você tenha comprado um produto que ao prová-lo não gostou, você pode efetuar a troca em até 30 dias corridos, bastando apenas entrar em contato pelos Canais de Relacionamento (Fale Conosco; WhatsApp; Telefone; E-mail) para tratar do assunto.<br />\r\nNestes casos solicitamos que o cliente embrulhe o produto em uma embalagem adequada (proteção ao produto) e o leve em qualquer agência dos Correios para postagem. Nesse tipo de troca é o cliente que arca com o custo de devolução e a N1Sports assume o custo do reenvio de outro produto.<br />\r\n<br />\r\nMas é importante que você se certifique:<br />\r\n-    Produto não foi usado nem tem indícios de uso ou manipulação<br />\r\n-    Produto deve estar com a embalagem original e com a etiqueta;<br />\r\n-    Todos os acessórios (se houver) devem estar juntos.<br />\r\n<br />\r\nCaso isso não seja respeitado pelo cliente, a troca será inviabilizada e os produtos que foram personalizados não podem ser trocados.<br />\r\nDepois que o produto for recebido pela N1Sports, em até 7 dias corridos outro produto será reenviado.<br />\r\nArrependimento<br />\r\nCaso você tenha comprado um produto e se arrependeu, você pode cancelar a compra em até SETE dias corridos, bastando apenas entrar em contato pelos Canais de Relacionamento (Fale Conosco; WhatsApp; Telefone; E-mail) para tratar do assunto.<br />\r\nVocê receberá uma autorização de Postagem Reversa para uso em qualquer agência dos Correios, que isenta do custo de frete e, depois que o produto for recebido pela N1Sports, em até SETE dias você será ressarcido.<br />\r\n<br />\r\nMas é importante que você se certifique:<br />\r\n-    Produto não foi usado nem tem indícios de uso ou manipulação<br />\r\n-    Produto deve estar com a embalagem original e com a etiqueta;<br />\r\n-    Todos os acessórios (se houver) devem estar juntos.<br />\r\n<br />\r\nCaso isso não seja respeitado pelo cliente, o cancelamento não poderá ser realizado e os produtos que foram personalizados não podem ter sua compra cancelada.<br />\r\n<br />\r\nProduto com defeito aparente<br />\r\nCaso você tenha comprado um produto que apresentou um defeito aparente, como uma costura desfeita ou um solado descolado, por exemplo, você pode solicitar o reparo ou a troca em até 30 dias, bastando apenas entrar em contato pelos Canais de Relacionamento (Fale Conosco; WhatsApp; Telefone; E-mail) para tratar do assunto.<br />\r\n<br />\r\nNestes casos solicitamos que o cliente mande fotos do produto assim que o receber, demonstrando o defeito aparente (exemplo: costura, mancha, descolado...). O cliente também receberá uma autorização de Postagem Reversa para uso em qualquer agência dos Correios, que isenta do custo de frete.<br />\r\n<br />\r\nPara troca imediata, sem necessidade de análise do fabricante, é importante que você se certifique:<br />\r\n-    Produto não foi usado nem tem indícios de uso ou manipulação<br />\r\n-    Produto deve estar com a embalagem original e com a etiqueta;<br />\r\n-    Todos os acessórios (se houver) devem estar juntos.<br />\r\n<br />\r\nCaso isso não seja respeitado pelo cliente, o cancelamento não poderá ser realizado.<br />\r\n<br />\r\nDepois que o produto for recebido pela N1Sports, em até SETE dias corridos outro produto será reenviado.<br />\r\n<br />\r\nProduto com defeito oculto<br />\r\nCaso você comece a usar um produto e logo ele apresente algum defeito, como uma costura que se desfaz ou um material que se descola, é preciso analisar se é o caso de troca.<br />\r\nO cliente tem até 30 dias para isso e recomendamos entrar em contato direto com o fabricante, que é obrigado a informar sobre a garantia dos seus produtos. Contudo, se para você for mais cômodo, entre em contato com a N1Sports pelos Canais de Relacionamento (Fale Conosco; WhatsApp; Telefone; E-mail) para tratar do assunto.<br />\r\nNestes casos solicitamos que o cliente mande fotos do produto, demonstrando o defeito (exemplo: costura, rasgo, descolado...). O cliente também receberá uma autorização de Postagem Reversa para uso em qualquer agência dos Correios, que isenta do custo de frete.<br />\r\nDepois que o produto for recebido pela N1Sports, será preciso analisar se o defeito surgiu por mau uso ou é realmente um -vício oculto- do produto e o fornecedor tem até 30 dias para solucionar o caso. <br />\r\n<br />\r\nSão exemplos de defeitos que surgem por mau uso e não incidem troca:<br />\r\n-    Camisa que foi esgaçada durante um jogo<br />\r\n-    Luva de goleiro que se desgastou rápido em virtude de um gramado ruim<br />\r\n-    Chuteira que rasgou o cabedal porque sofreu uma pisada<br />\r\n-    Tecido que se desgastou por lavagem e/ou secagem incorreta<br />\r\n<br />\r\nPedido entregue incorreto<br />\r\nCaso você tenha comprado um produto e na hora que recebeu ficou constatado que não era esse o pedido, você pode solicitar a troca em até SETE dias, bastando apenas entrar em contato pelos Canais de Relacionamento (Fale Conosco; WhatsApp; Telefone; E-mail) para tratar do assunto.<br />\r\nVocê receberá uma autorização de Postagem Reversa para uso em qualquer agência dos Correios, que isenta do custo de frete.<br />\r\nNão use o produto e lembre-se de remetê-lo de volta na embalagem original, com etiqueta e junto com todos os seus acessórios (se houver).<br />\r\nDepois que o produto for recebido pela N1Sports, em até 48 horas o pedido correto estará sendo enviado.<br />\r\n<br />\r\nCONDIÇÕES DE TROCA E DEVOLUÇÃO<br />\r\nQueremos que você fique completamente satisfeito ao comprar na N1Sports, mas sabemos que nem sempre isso é possível. Por isso, se você precisar trocar ou devolver a mercadoria, fique atento às seguintes condições:<br />\r\n<br />\r\nO produto deverá estar nas seguintes condições:<br />\r\n-    Não possuir sinais de uso, como manchas, odor, danos estéticos ou funcionais;<br />\r\n-    Não ter sido lavado;<br />\r\n-    Ter sua embalagem original preservada;<br />\r\n-    Ter os acessórios (quando for o caso) que o acompanham e também as etiquetas.<br />\r\n<br />\r\nRespeitar os prazos:<br />\r\n-    30 dias corridos a partir da data do recebimento em caso de insatisfação<br />\r\n-    7 dias corridos a partir da data do recebimento em caso de defeito ou erro no pedido<br />\r\n<br />\r\nO produto enviado pelo cliente para troca ou cancelamento é analisado pela N1Sports em até 7 dias corridos e, uma vez certificadas as condições, é dado andamento à solicitação de troca. O produto que não contemplar as condições acima especificadas será remetido de volta o cliente.<br />\r\nItens personalizados ao cliente não podem ser trocados em razão da customização realizada. Em caso de defeito, cada caso será gerenciado individualmente.<br />\r\nPara não expor os clientes a riscos, peças íntimas e itens de compressão não podem ser trocados ou devolvidos. Em caso de defeito, cada caso será gerenciado individualmente.<br />\r\n<br />\r\nPROCEDIMENTOS PARA TROCA<br />\r\n<br />\r\nPara trocar um produto o cliente deve seguir os seguintes passos:<br />\r\n1.    Entrar em contato com os Canais de Relacionamento da N1Sports;<br />\r\n2.    Informar os motivos da troca ou devolução;<br />\r\n3.    Aguardar orientação da nossa equipe de Suporte ao Cliente;<br />\r\n4.    Embalar o produto e postar o produto em uma agência dos Correios.<br />\r\n<br />\r\nEmbalagem para devolução:<br />\r\nEmbalar o produto de acordo com os critérios de postagem dos Correios (papel pardo, caixa de papelão ou caixa dos Correios), tendo o cuidado para que essa embalagem seja adequada (proteção), não sendo nem menor (que amasse ou danifique o produto) nem maior (que gere custos adicionais pelo volume).<br />\r\nDe posse do Código de Postagem Reversa o cliente deve se dirigir a uma agência dos Correios e informar o código. Se possível leve o produto já embalado ou a embalagem de transporte junto, caso contrário os Correios irão cobrar pela embalagem e no Código de Postagem não está contemplada essa despesa.<br />\r\n<br />\r\nEndereço para devolução:<br />\r\nN1 Sports<br />\r\nRua Umbu 112/401 - Bairro Passo D`Areia<br />\r\nPorto Alegre/RS - CEP 91350 100<br />\r\n<br />\r\n<br />\r\nDespesas com a devolução<br />\r\nA N1Sports arca com os custos de devolução nos casos relacionados a defeitos, cancelamentos e pedidos enviados errados por meio do Código de Postagem Reversa, que é uma autorização para o cliente utilizar os Correios sem precisar desembolsar absolutamente nada. <br />\r\nAo entrar em contato com os Canais de Relacionamento, o cliente é orientado a como proceder e receberá no prazo de até 48 horas o Código para Postagem Reversa.<br />\r\nNo caso de troca por insatisfação com o produto é o cliente que arca com a despesa de devolução e a N1Sports assume os custos com o reenvio de outro produto.<br />\r\n<br />\r\n RESTITUIÇÃO DE VALORES<br />\r\nNos casos de cancelamento da compra por arrependimento, o cliente tem direito à devolução do valor pago, exceto do custo do frete quando houver. As formas para restituição podem ser:<br />\r\n<br />\r\n-    Vale-compra, de uso pessoal e intransferível, a ser utilizado em qualquer compra no site, com prazo de validade de 6 meses;<br />\r\n-    Crédito em conta corrente, de mesmo nome e CPF do cliente, para o caso de pagamentos realizados por meio de boleto bancário, depósito ou transferência;<br />\r\n-    Estorno no cartão de crédito ou de débito para o caso de pagame